import React from 'react'

//import $ from 'jquery';

const Refresh = React.createClass({
  render: () => {
      return (
          <div>
              <input type="submit" value="Search"  />
              
          </div>
      );
  }
});



function Users() {
  return (
    <div>
          <header id="users">
              <div className="container">
                   <Refresh/>
              </div>
          </header>
      </div>
  );
}

export default Users;

